io, Business, etc...\nAnd work with all additional things about the website like Security, Speed Optimization, SEO, etc... (After Complete this you'll be able to create any type of website \u0026 able to do freelancing...)\nThen we'll move on marketplace Fiverr and Upwork to do freelancing...\nWhere we'll see all the details how can create an account, gig, give an exam, send a proposal, etc... try to getting work form as well in this time work with...\n\n    Advance Front-end Development\n    Advanced CSS3\n    CSS3 Animation\n    JavaScript \u0026 jQuery\n    SCSS\n    All Essential jQuery Plugins\n    Basic Adobe Photoshop CS6\n    PSD/Adobe XD/JPG/PNG to HTML\n\n--------After completing those We'll do 10-15 live website designs.\n\nThen We'll get a template,\nDoing the design based on Themeforest Standard\nAnd submit the design for ThemeForest where we'll see all the details.\n\nThen we'll move on WordPress Theme Development...\n\nকোর্স এ জইন করার জন্য এই গ্রুপ এ Add হয়েযান\nhttps://www.facebook.com/groups/LearnCodeWithFun/\n\nWebsite: https://developerjillur.me/\nFacebook Page: https://www.facebook.com/DeveloperJillur.me/\nFacebook:  https://www.facebook.com/developerjillur","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/nejbmj_2gBo/hqdefault.jpg?sqp=-oaymwEbCKgBEF5IVfKriqkDDggBFQAAiEIYAXABwAEG\u0026rs=AOn4CLCrBgAOofOA0s50bDE2zutfW3sytw","width":168,"height":94},{"url":"https://i.ytimg.com/vi/nejbmj_2gBo/hqdefault.jpg?sqp=-oaymwEbCMQBEG5IVfKriqkDDggBFQAAiEIYAXABwAEG\u0026rs=AOn4CLD3hgZMaa8sp4a0ECohsTYlhLu6iw","width":196,"height":110},{"url":"https://i.ytimg.com/vi/nejbmj_2gBo/hqdefault.jpg?sqp=-oaymwEcCPYBEIoBSFXyq4qpAw4IARUAAIhCGAFwAcABBg==\u0026rs=AOn4CLAKVPGbDyV5nkc8BQSXQSLiAWM-Qw","width":246,"height":138},{"url":"https://i.ytimg.com/vi/nejbmj_2gBo/hqdefault.jpg?sqp=-oaymwEcCNACELwBSFXyq4qpAw4IARUAAIhCGAFwAcABBg==\u0026rs=AOn4CLDoIVfViLhrSa3dTRVwYLrgl1cPBQ","width":336,"height":188},{"url":"https://i.ytimg.com/vi/nejbmj_2gBo/ma ve shown full details on how you can create a website with HTML, CSS row coding and make it perfect.\nMy Live Code: https://codepen.io/jillur-rahman/pen/NWxdObE\nTemplate link: https://bit.ly/2zRfy5i\nGet details about Hand Holding Support Course: \n+8801889972995\nLFWF Academy Website: https://www.lfwfacademy.com\n\nFreelancing এর উপর সম্পূর্ণ ফ্রীতে Web Development / Website Create নিয়ে Free Online Course from beginner to advanced.\n\nপ্রতিদিন ১০-১৫মিনিট এর ক্লাস এ ফ্রীতেই Freelancing শিখুন যেকুনো জাইগা থেকে  সম্পূর্ণ গাইডলাইনের সাথে...\nCourses এ যইন করার জন্য এবং সকল আপডেট পাওয়ার জন্য এই গ্রউপ এ জইন করুন\nhttps://www.facebook.com/groups/LearnFreelancingWithFun/\n\nClass Playlist:  https://www.youtube.com/watch?v=OxFMwbzWnKE\u0026list=PLYP3nGPfEX3ozR7diS7raz5JeHcEYEbsf\n\nআমার সম্পর্কে বিস্তারিত জানতে :\nhttps://developerjillur.me/my-resume/\n\nকি কি থাকছে এই কোর্স এ? আমরা কি কি শিখবো এই কোর্স এ?\n\n    HTML5 (Beginning to advanced)\n    CSS3 (Beginning to advanced)\n    Bootstrap 4\n    Responsive Design\n\n    --------After completing those We'll do 4-5 live website design\n\n** A-Z WordPress customization\n\nCreating 50-60 live website and work with all the popular themes \u0026 needed plugins.\n\nTry to do all types of websites, for Example E-commerce, News, Blogging, Portfolio, Business, etc...\nAnd work with all additional things about the website like Security, Speed Optimization, SEO, etc... (After Complete this you'll be able to create any type of website \u0026 able to do freelancing...)\nThen we'll move on marketplace Fiverr and Upwork to do freelancing...\nWhere we'll see all the details how can create an account, gig, give an exam, send a proposal, etc... try to getting work form as well in this time work with...\n\n    Advance Front-end Development\n    Advanced CSS3\n    CSS3 Animation\n    JavaScript \u0026 jQuery\n    SCSS\n    All Essential jQuery Plugins\n    Basic Adobe Photoshop CS6\n    PSD/Adobe XD/JPG/PNG to HTML\n\n--------After completing those We'll do 10-15 live website designs.\n\nThen We'll get a template,\nDoing the design based on Themeforest Standard\nAnd submit the design for ThemeForest where we'll see all the details.\n\nThen we'll move on WordPress Theme Development...\n\nকোর্স এ জইন করার জন্য এই গ্রুপ এ Add হয়েযান\nhttps://www.facebook.com/groups/LearnCodeWithFun/\n\nWebsite: https://developerjillur.me/\nFacebook Page: https://www.facebook.com/DeveloperJillur.me/\nFacebook:  https://www.facebook.com/developerjillur"},"lengthSeconds":"4449","ownerProfileUrl":"http://www.youtube.com/channel/UCtL1A8QP4hLUx9vAy8mgvSw","externalChannelId":"UCtL1A8QP4hLUx9vAy8mgvSw","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BY","BZ","CA","CC","CD","CF","CG","CH","CI","CK","CL","CM","CN","CO","CR","CU","CV","CW","CX","CY","CZ","DE","DJ","DK","DM","DO","DZ","EC","EE","EG","EH","ER","ES","ET","FI","FJ","FK","FM","FO","FR","GA","GB","GD","GE","GF","GG","GH","GI","GL","GM","GN","GP","GQ","GR","GS","GT","GU","GW","GY","HK","HM","HN","HR","HT","HU","ID","IE","IL","IM","IN","IO","IQ","IR","IS","IT","JE","JM","JO","JP","KE","KG","KH","KI","KM","KN","KP","KR","KW","KY","KZ","LA","LB","LC","LI","LK","LR","LS","LT","LU","LV","LY","MA","MC","MD","ME","MF","MG","MH","MK","ML","MM","MN","MO","MP","MQ","MR","MS","MT","MU","MV","MW","MX","MY","MZ","NA","NC","NE","NF","NG","NI","NL","NO","NP","NR","NU","NZ","OM","PA","PE","PF","PG","PH","PK","PL","PM","PN","PR","PS","PT","PW","PY","QA","RE","RO","RS","RU","RW","SA","SB","SC","SD","SE","SG","SH","SI","SJ","SK","SL","SM","SN","SO","SR","SS","ST","SV","SX","SY","SZ","TC","TD","TF","TG","TH","TJ","TK","TL","TM","TN","TO","TR","TT","TV","TW","TZ","UA","UG","UM","US","UY","UZ","VA","VC","VE","VG","VI","VN","VU","WF","WS","YE","YT","ZA","ZM","ZW"],"isUnlisted":false,"hasYpcMetadata":false,"viewCount":"45385"
